import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import sdata from "./Sdata";

function cval(val) {
  return (
    <Card
      name={val.name}
      imgsrc={val.imgsrc}
      title={val.title}
      link={val.link}
    />
  );
}

ReactDOM.render(
<>
{sdata.map(cval)}</>, document.getElementById("root"));
